import Para from "../../../components/Para";
import img1 from "../../../assets/imgs/sales/level2-image2.png";
import img2 from "../../../assets/imgs/sales/level2-image1-1-600x747.png";
import SideNavSales from "../../../components/SideNavSales";

const Sales = () => {
  return (
    <>
      <SideNavSales />
      <div className="product-page-container">
        <div className="product-section-container">
          <div className="right">
            <h1>Maximize your selling potential</h1>
            <div className="para" key={para.id}>
              <h2>{para.title}</h2>
              <p>{para.content}</p>
              <button>Learn More...</button>
            </div>
          </div>
          <div className="left">
            <img src={img1} />
          </div>
        </div>
        <div className="product-section-container row-reverse">
          <div className="right">
            <Para />
          </div>
          <div className="left">
            <img src={img2} />
          </div>
        </div>
      </div>
    </>
  );
};

export default Sales;
